  input: '"TEXT","F3XN","C00084954","On August 1, 2006 the Committee received a refund
    due to an overpayment of payroll taxes in the amount of $4,408.76 from the Internal
    Revenue Service for the fourth quarter of 2005. This receipt is reported on Schedule
    A supporting line 15. After reviewing our records and corresponding with the Internal
    Revenue Service we determined that the Committee had not overpaid its payroll
    taxes and all returns and payments had been properly reported. We then contacted
    our bank where all of our payroll tax deposits are made and asked them to research
    the issue. The bank subsequently discovered that they had overpaid the Internal
    Revenue Service on our account. We have repaid Delta Trust and Bank in September
    and our October Monthly Report will disclose the payment to them.     On August
    1, 2006 the Committee received a refund the Arkansas Big Buck Classic for $300.00
    due to an overpayment for a booth rental at the event. The original payment to
    them was made entirely with federal funds. This receipt is reported on Schedule
    A supporting line 15.    On August 2, 2006 the Committee paid $150.00 to Allison
    Johnson for fundraising fees. This disbursement is reported on Schedule H4 supporting
    Line 21a. Allison Johnson is not an employee of the Committee but is an independent
    contractor. This fundraising expenditure was for our party committee only, and
    not made on behalf of any specifically or clearly identified federal candidate.
    No federal candidates were mentioned in the fundraising activities. All expenditures
    for fundraising were made solely on behalf of our party committee and have been
    properly reported.    All payments for salaries and fringe benefits listed on
    Schedule B supporting Line 21(b) and Schedule H4 supporting Line 21(a)(i) & (ii)
    were to employees of the Committee who did not spend more than 25 percent of their
    compensated time during the reporting period engaged in Federal Election Activity."'
